import React from 'react';

const FaceRecognition = ({imageUrl, box}) => {
    return (
        <div>
            <img id='inputimage' src={imageUrl} alt='image' width='500px' height='auto' />
            <div className='bounding-box'></div>
        </div>
    );
}

export default FaceRecognition;
